import React, { Component } from 'react';
import { Head4 } from '../styles/Head4';
import { Head3 } from '../styles/Head3';

import { Butt } from '../components/Butt';
import { Butt_Add } from '../components/Butt_Add';
import { Butt_Remv } from '../components/Butt_Remv';
import Titl_Crea from '../components/Titl_Crea';
import { MdRemove, MdPlaylistAdd } from 'react-icons/md';
import { IoMdTrash,IoMdAddCircleOutline } from "react-icons/io";
import Poll_Inq from '../components/Poll_Inq';


import { FaLaptopCode, FaPaintBrush, FaDatabase} from 'react-icons/fa'


export default class Front_End extends Component {
	state={
    proc: [
    {
      icon: <FaLaptopCode/>,
      titl: 'Front-end',
      activeTab: 0,
    },
    {
      icon: <FaPaintBrush/>,
      titl: 'Graphic Design',
      activeTab: 1,
    },
    {
      icon: <FaDatabase/>,
      titl: 'Programming',
      activeTab: 2,
        }
    ]
  }



  render() {
    return (

      <section className="about"> 

        <div className="how-portfolio">

              <div className="portfolio-center-nav">
                {this.state.proc.map((item, index) => {
                  return (
                  <article key={index} className="portfolio-nav">
                    <span className="nav-link">{item.icon}</span>
                    <h6 className="nav-link">{item.titl}</h6>

                  </article>
                  );
                })}
              </div>
        </div>
    </section>

    );
  }

}
